import React from 'react'
import './card.css'

export default function Card({ image, title, describtion, rate }) {
    return (
        <div className='movie-card'>
            <img className='movie-image' src={require(`./images/${image}`)} alt='' />
            <div>{title}</div>
            <div>{describtion}</div>
            <div>{rate}</div>

        </div>
    )
}
